import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    root:{
        // maxWidth: '100%'
        width: '200px',

    },
    img:{
        height: '250px',
    },
    media:{
        // height: 0,
        // paddingTop: "56.25%",
        width: '100%',
        height: '100%',
        objectFit: 'cover',
        boxSizing: 'border-box',
    },
    cardActions:{
        display: 'flex',
        justifyContent: 'flex-end',
    },
    cardContent:{
        display: 'flex',
        justifyContent: 'space-betweem',
        flexDirection: 'column',
        fontFamily: 'calibri',
    }
}));
